-- ----------------------------
-- Table structure for `file`
-- ----------------------------
DROP TABLE IF EXISTS `file`;
CREATE TABLE `file` (
  `batch_no` varchar(50) DEFAULT NULL COMMENT '文件批次号',
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(200) DEFAULT NULL COMMENT '附件名称',
  `address` varchar(200) DEFAULT NULL COMMENT '文件地址',
  `suffix` varchar(200) DEFAULT NULL COMMENT '文件后缀名称',
  `createtime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_BATCH_NO_NO` (`batch_no`,`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统文件信息表';

