-- ----------------------------
-- Table structure for `notice`
-- ----------------------------
DROP TABLE IF EXISTS `notice`;
CREATE TABLE `notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `isdelete` int(11) DEFAULT '0' COMMENT '0正常，1删除',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `createUser` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `projectName` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '项目名称',
  `opening_area` decimal(10,6) DEFAULT NULL COMMENT '开发范围现状土地面积，总面积： ㎡；集体土地 ㎡',
  `construction` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '可开发建筑物性质，厂房  办公  商业  居住  旅馆业  商业公寓  公共配套设施  学校 交通市政设施  其他',
  `plot_ratio` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '现状容积率',
  `total_area` decimal(10,6) DEFAULT NULL COMMENT '规划建筑总面积,总面积： ㎡',
  `area_of_plot_ratio` decimal(10,6) DEFAULT NULL COMMENT '计入容积率总建筑面积,面积： ㎡',
  `assessment` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '评估报告,上传PDF附件',
  `research` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '可行性研究报告,上传附件',
  `source` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '项目来源,国资、集体',
  `project_summary` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '项目概括（内容包含土地面积、土地用途、地理位置、规划情况以及合作方案中的重大事项等）',
  `organization` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '交易机构,深圳联合产权交易所',
  `intention` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '是否有意向方（仅龙岗项目）',
  `conditions` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '意向合作方应具备的条件,（注册资本、房地产开发资质、成立年限、资产总额、年度负债率、纳税总额、其他条件（依据各区股份合作公司城市更新项目引入合作开发主体工作规定要求）',
  `cooperation` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '合作方式,（物业置换、货币补偿、物业置换+货币补偿、其他）',
  `benefit` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '利益分配方式',
  `proportion` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '合作分成比例',
  `deadline` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '合作开发期限和配套设施建设',
  `instruction` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '其他应披露的事项（特别事项说明及风险提示）',
  `decision` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '决策信息',
  `plot` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '地块包含项目方, 多委托方设置，一个标的一个项目，可能有多委托方 ',
  `enterprise` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '批准单位名称',
  `filename` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '批准文件名及文号',
  `payment` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '价款支付方式,A1:银行转账 A2:现金 A3:银行扣款',
  `trading_terms` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '交易条件与合作方式',
  `information` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '业务咨询',
  `complaint` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '业务投诉',
  `fax` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '传真',
  `url` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '网址',
  `weChat_official` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '微信公众号',
  `address` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '联系地址',
  `is_partner` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '是否收取合作方方服务费,Y:收取 N:不收',
  `is_guarantee` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '合作方是否保证金转服务费/价款,B1:都不转 B2:只转价款   B3:只转服务费   B4:既转价款也转服务费',
  `is_client` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '是否收取委托方服务费,Y:收取 N:不收',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='福田区合作开发接口对接表';

